Nobody wants to see their loved ones health deteriorate in front of their eyes. 
And we would do everything in our being to help prevent this.
That’s why I’ve started a GoFundMe to help my best friend of 10 years raise money for treatment in Germany.
My best friend has been diagnosed with Idiopathic Intracranial Hypertension (IIH) which if left untreated could end up making her fully blind. But she has a chance to get treated in Germany since there is no treatment in the UK.
